def find_first_non_repeating_char(string):
    result = ""
    repeated = ""

    for c in string:
        if c in repeated:
            continue

        if c in result:
            result = result.replace(c, "")
            repeated += c
        else:
            result += c

    if result == "":
        return -1

    return result[0]

