def generate_primes(n):
    is_prime = [True] * (n+1)
    is_prime[0] = is_prime[1] = False

    p = 2
    while p*p <= n:
        if is_prime[p]:
            for i in range(p*p, n+1, p):
                is_prime[i] = False
        p += 1

    primes = []
    for i in range(2, n+1):
        if is_prime[i]:
            primes.append(i)

    return primes

# Generate prime numbers between 1 and 10,000
primes = generate_primes(10000)
