    primes = []
    for num in numbers:
        for i in range(2, num):
            if (num % i) == 0:
                break
        else:
            primes.append(num)
    return len(primes)

def composite_count(numbers):
    composites = []
    for num in numbers:
        for i in range(2, num):
            if (num % i) == 0:
                composites.append(num)
                break
    return len(composites)

