def fibonacci(n):
    if n < 0:
        raise ValueError("n must be a non-negative integer")
    elif n == 0:
        return ([0], 0)
    elif n == 1:
        return ([0, 1], 1)
    else:
        sequence = [0, 1]
        for _ in range(2, n + 1):
            sequence.append(sequence[-1] + sequence[-2])
        return (sequence, n)

