def sieve_of_eratosthenes(n):
    prime = [True] * (n + 1)
    p = 2
    while p * p <= n:
        if prime[p] == True:
            for i in range(p * p, n + 1, p):
                prime[i] = False
        p += 1
    return prime

def generate_primes(limit):
    primes = []
    prime = sieve_of_eratosthenes(limit)
    for p in range(2, limit + 1):
        if prime[p]:
            primes.append(p)
    return primes

