def bisection_root(n, low, high, epsilon):
    mid = (low + high) / 2
    error = abs(mid ** 7 - n)

    if error < epsilon:
        return mid
    elif mid ** 7 > n:
        return bisection_root(n, low, mid, epsilon)
    else:
        return bisection_root(n, mid, high, epsilon)

