def countDistinctCharsRecursive(text, charSet, distinctChars):
    if len(text) == 0:
        return len(charSet), distinctChars
    if text[0].isspace():
        return countDistinctCharsRecursive(text[1:], charSet, distinctChars)
    charSet.add(text[0])
    distinctChars.append(text[0])
    return countDistinctCharsRecursive(text[1:], charSet, distinctChars)

