def count_elements(my_list):
    if len(my_list) == 0:
        return []

    counts = []
    for element in my_list:
        found = False
        for i in range(len(counts)):
            if counts[i][0] == element:
                counts[i] = (element, counts[i][1] + 1)
                found = True
                break
        if not found:
            counts.append((element, 1))

    counts.sort(key=lambda x: x[1], reverse=True)

    return counts

