    for i in range(2, int(100**0.5) + 1):
        if isPrime[i]:
            for j in range(i * i, 101, i):
                isPrime[j] = False

    sum = 0
    for i in range(2, 101):
        if isPrime[i]:
            sum += i * i

    return sum

print(sum_of_prime_squares())  # Output: 6570

