def ascii_sort(string):
    lowercase_string = ""
    for char in string:
        if char.islower():
            lowercase_string += char

    unique_letters = ""
    for char in lowercase_string:
        if char not in unique_letters:
            unique_letters += char

    sorted_string = ""
    for i in range(97, 123): # ASCII values for lowercase alphabets (a=97, z=122)
        for char in unique_letters:
            if ord(char) == i:
                sorted_string += char

    return sorted_string

# Example usage:
print(ascii_sort("baacdc"))  # Output: "abcd"
print(ascii_sort("AbCaDc"))  # Output: "acd"

