def binary_search(array, target):
    lower = 0
    upper = len(array) - 1
    while lower <= upper:
        mid = (lower + upper) // 2
        if array[mid] == target:
            return mid
        elif array[mid] < target:
            lower = mid + 1
        else:
            upper = mid - 1

