class Library:
    def __init__(self):
        self.books = {}

    def add_book(self, title, isbn):
        self.books[title] = isbn

    def get_isbn_by_title(self, title):
        if title in self.books:
            return self.books[title]
        else:
            return None

    def get_title_by_isbn(self, isbn):
        for title, isbn_num in self.books.items():
            if isbn_num == isbn:
                return title
        return None

