def find_greatest_difference(lst):
    if len(lst) < 2:
        raise ValueError('The input list must contain at least two elements.')
    max_diff = lst[1] - lst[0]
    for i in range(1, len(lst)):
        diff = lst[i] - lst[i-1]
        if diff > max_diff:
            max_diff = diff
    return max_diff

