            result.append(reverse_word(word))
            result.append(' ')
            word_start = i + 1
    word = string[word_start:]
    result.append(reverse_word(word))
    return ''.join(result)

def reverse_word(word):
    reversed_word = ''
    for i in range(len(word)-1, -1, -1):
        reversed_word += word[i]
    return reversed_word

