def calculateMax ( N , M , K ) :
    ans = - 1
    low = 0
    high = M
    while ( low <= high ) :
        mid = ( low + high ) / 2
        val = 0
        L = K - 1
        R = N - K
        val += mid
        if ( mid >= L ) :
            val += ( L ) * ( 2 * mid - L - 1 ) / 2
        else :
            val += mid * ( mid - 1 ) / 2 + ( L - mid )
        if ( mid >= R ) :
            val += ( R ) * ( 2 * mid - R - 1 ) / 2
        else :
            val += mid * ( mid - 1 ) / 2 + ( R - mid )
        if ( val <= M ) :
            ans = max ( ans , mid )
            low = mid + 1
        else :
            high = mid - 1
    return int ( ans )
