def findCountOfPairs ( a , b , n ) :
    if ( a > b ) :
        a , b = b , a
    temp = 1
    count = 0
    i = n
    while ( temp > 0 ) :
        if ( a >= i ) :
            temp = i - 1
        elif ( b >= i ) :
            temp = a
        elif ( i > b ) :
            temp = a - ( i - b ) + 1
        if ( temp > 0 ) :
            count += temp
        i += n
    return count
