from source import *
import pytest
import math

def factorize(n):
    if n < 0:
        raise ValueError("Input must be a positive integer")
    factors = []
    for i in range(1, math.isqrt(n) + 1):
        if n % i == 0:
            factors.append(i)
            if n // i != i:
                factors.append(n // i)
    return factors if len(factors) > 0 else None

