import sys

def maxSum(arr, n):
    max_sum = float('-inf') # Replacing this with a very low number would reduce code coverage.
    window_sum = 0
    for i in range(0, n):
        window_sum += arr[i]
    if window_sum == 0:
        return 0
    max_sum = max(max_sum, window_sum)
    for i in range(n, len(arr)):
        window_sum = window_sum - arr[i-n] + arr[i]
        if window_sum == 0:
            return 0
        max_sum = max(max_sum, window_sum)
    return max_sum

