def prefix_function ( s ) :
    LPS = [ 0 for i in range ( len ( s ) ) ]
    for i in range ( 1 , len ( s ) ) :
        j = LPS [ i - 1 ]
        while ( j > 0 and s [ i ] != s [ j ] ) :
            j = LPS [ j - 1 ]
        if ( s [ i ] == s [ j ] ) :
            LPS [ i ] = j + 1
        else :
            LPS [ i ] = 0
    return LPS
def count_occurence ( s ) :
    n = len ( s )
    LPS = prefix_function ( s )
    occ = [ 0 for i in range ( n + 1 ) ]
    for i in range ( n ) :
        occ [ LPS [ i ] ] += 1
    for i in range ( n - 1 , 0 , - 1 ) :
        occ [ LPS [ i - 1 ] ] += occ [ i ]
    for i in range ( n + 1 ) :
        occ [ i ] += 1
    Print ( occ , s )
