def find_next ( n , k ) :
    ans = 0
    if ( ( n & ( 1 << k ) ) == 0 ) :
        cur = 0
        for i in range ( k ) :
            if ( n & ( 1 << i ) ) :
                cur += 1 << i
        ans = n - cur + ( 1 << k )
    else :
        first_unset_bit , cur = - 1 , 0
        for i in range ( 64 ) :
            if ( ( n & ( 1 << i ) ) == 0 ) :
                first_unset_bit = i
                break
            else :
                cur += ( 1 << i )
        ans = n - cur + ( 1 << first_unset_bit )
        if ( ( ans & ( 1 << k ) ) == 0 ) :
            ans += ( 1 << k )
    return ans
