def isPrime ( n ) :
    if ( n <= 1 ) : return False
    if ( n <= 3 ) : return True
    if ( n % 2 == 0 or n % 3 == 0 ) :
        return False
    i = 5
    while ( i * i <= n ) :
        if ( n % i == 0 or n % ( i + 2 ) == 0 ) :
            return False
        i += 6
    return True
def primorial ( n ) :
    p = 2 ; n -= 1 ; i = 3
    while ( n != 0 ) :
        if ( isPrime ( i ) ) :
            p = p * i
            n -= 1
        i += 1
    return p
def findNextPrime ( n ) :
    nextPrime = n + 2
    while ( True ) :
        if ( isPrime ( nextPrime ) ) :
            break
        nextPrime += 1
    return nextPrime
def fortunateNumber ( n ) :
    p = primorial ( n )
    return findNextPrime ( p ) - p
